import Header from '../components/Header';

const LayoutStyle = {
    margin: 20,
    padding: 20,
}

const Layout = (a) => {
    return (
        <div style={LayoutStyle}>
            <Header />
            <main>
                { a.children }
            </main>
        </div>
    );
}

export default Layout;
